import './App.css';

function App() {
  return (
    <form name='form'>
      <header className="container">
        {/* <div className='row'> */}
        <div className='col'>
          <div className="form-group">
            <input type="text" id="name" className="form-control txt" placeholder="Product name" />
            <textarea id="description" className="form-control txt" rows="5" placeholder="Product desctiption" />
            <input type="text" id="price" className="form-control txt" placeholder="Product price" />
            <input type="file" id="image" className="form-control txt" placeholder="Image" />
            <button id="name" className='form-control btn primary-btn'>Add</button>
          </div>
        </div>
        <div className='col'>
          <h2>List of products</h2>
        </div>
        {/* </div> */}


      </header>
    </form>
  );
}

export default App;
